import React from "react";
import styled from "styled-components";
import { Row, Col, Button } from "antd";

export const OptionBtn = styled(Button)`
	background: #eeeeee;
	color: #000000;
	border: none;

	font-size: 15px;
	display: block;
	margintop: 10px;

	&:hover {
		background: #0984e3;
		color: #ffffff;
	}
`;

export const fullCol = "xs={16} sm={14} md={10} lg={8} xl={8}";
